DROP TABLE IF EXISTS OrgaoSuperior
DROP TABLE IF EXISTS OrgaoSubordinado
DROP TABLE IF EXISTS UnidadeGestora
DROP TABLE IF EXISTS Funcao
DROP TABLE IF EXISTS SubFuncao
DROP TABLE IF EXISTS Programa



CREATE TABLE OrgaoSuperior
	(cdOrSup	INTEGER UNSIGNED	PRIMARY KEY,
	 nmOrSup	VARCHAR(50)	);

CREATE TABLE OrgaoSubordinado
	(cdOrSub	INTEGER UNSIGNED	PRIMARY KEY ,
	 nmOrSub	VARCHAR(50)	);

CREATE TABLE UnidadeGestora
	(cdUniGes	INTEGER UNSIGNED	PRIMARY KEY,
	 nmUniGes	VARCHAR(50)	);

CREATE TABLE Funcao
	(cdFun	INTEGER UNSIGNED	PRIMARY KEY,
	 nmFun	VARCHAR(25)	);

CREATE TABLE SubFuncao
	(cdSubFun	INTEGER UNSIGNED	PRIMARY KEY,
	 nmSubFun	VARCHAR(55)	);

CREATE TABLE Programa
	(cdProg	INTEGER UNSIGNED	PRIMARY KEY,
	 nmProg	VARCHAR(115)	);














